import React from "react";

const Logo = () => {
  return (
    <div className="m-10 gap-7 grid grid-cols-2 right-10">
      <div>
        <img className="w-48" src={"/assets/apf.png"} alt="" />
      </div>
    </div>
  );
};

export default Logo;
